import {BrowserRouter,Routes,Route} from 'react-router-dom'



function App() {

  const [click,setClick] =useState(true)

  function handleClick(event){
    setClick((click)=>!click)
  }
  return (
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Login/>}/>
          <Route path='/user' elemets={<SharedLayout/>}>
            <Route index elemet={<AddTask/>}/>
            <Route path='task' elemet={<Task/>}/>
            <Route path='assignedby' element={<AssignedBy/>}/>
            <Route path='assignedto' element={<AssignedTo/>}/>
          </Route>

        </Routes>
      </BrowserRouter>
  );
}

export default App;
